function checkCityState(input) {
    const regex = /^([a-zA-Z])+[\t\s+-]+([a-zA-Z]{2})$/;
   if (input.match(regex)) {
        const [, city, state] = input.match(regex);
        const match = Object.entries(statesAndCities).some(([stateName, cities]) => stateName === state && cities.includes(city));
        matchPrompt.textContent = "Match found!";
   } else {
        matchPrompt.textContent = "No match found.";
    }
}

function tableToObject(table) {
	let object = {};
	table.forEach((row) => {
		let state = row.split("\t")[1];
		let city = row.split("\t")[0];
		if (!object[state]) {
			object[state] = [city];
		} else {
			object[state].push(city);
		}
	});
	return object;
}

const getRegex = (input) => {
    let lines = input.split("\n");
    let regexString = "^(";

    lines.forEach(function(line, i) {
    let parts = line.split("\t");
    let city = parts[0];
    let state = parts[1];
    if (i > 0) {
        regexString += "|";
    }
    regexString += city + "\\s" + state;
    });

    regexString += ")";
    let regex = new RegExp(regexString, "i");
    console.log("let regex = " + regex); 
    const result = `let regex = ${regex}`
    return result;
}

const complexConvert = (input) => {
	let lines = input.split("\n");
	let array = {};

	lines.forEach(function (line) {
		let parts = line.split("\t");
		let state = parts[0];
		let abbr = parts[1];
		let zip = parts[2];
		let county = parts[3];
		let city = parts[4];
		if (!array[abbr]) {
			array[abbr] = { state: state, abbr: abbr, cities: {} };
		}
		if (!array[abbr].cities[city]) {
			array[abbr].cities[city] = { cityName: city, zips: [], county: county };
		}
		array[abbr].cities[city].zips.push(zip);
	});
	console.log("Const Array = ", array);
    const result = JSON.stringify(array, null, 2);
    document.getElementById("output").innerText = result;
	return array;
};

const locationMatch = (input) => {
	const inputArray = input.split(" ");
	const city = inputArray[0];
	const stateAbbr = inputArray[1];
	const zip = inputArray[2];

	console.log({ city, stateAbbr, zip });
	let match = statesAndCities[stateAbbr].Cities.find((cityData) => cityData.cityName === city && cityData.zips.includes(zip));
	if (match) {
		return match;
	} else {
		return "Error!: " + city + " " + stateAbbr + " " + zip + " not found in data";
	}
};


