const cityZipCheck = (input) => {
	let lines = input.split("\n");
	let regexString = "^(";

	lines.forEach(function (line, i) {
		let parts = line.split("\t");
		let city = parts[0];
		let state = parts[1];
		if (i > 0) {
			regexString += "|";
		}
		regexString += city + "\\s[A-Z]{2}\\s" + state;
	});

	regexString += ")";
	let regex = new RegExp(regexString, "i");
	console.log("let regex = " + regex);
	const result = `let regex = ${regex}`;
	return result;
};

convertZipRegex.addEventListener("click", function () {
    regexOutput.textContent = cityZipCheck(input.value);
});

